def get_x_components(x):
    a = x[0:12]
    U = x[12:24]
    Q = x[24:36]
    Kappa_g = x[36:36+n_g]
    Lambda_g = x[36+n_g:36+2*n_g]
    lambda_g = x[36+2*n_g:36+3*n_g]
    Lambda_gamma = x[36+3*n_g:36+3*n_g+n_gamma]
    lambda_gamma = x[36+3*n_g+n_gamma:36+3*n_g+2*n_gamma]
    Kappa_N = x[36+3*n_g+2*n_gamma:36+3*n_g+2*n_gamma+n_gN]
    Lambda_N = x[36+3*n_g+2*n_gamma+n_gN:36+3*n_g+2*n_gamma+2*n_gN]
    lambda_N = x[36+3*n_g+2*n_gamma+2*n_gN:36+3*n_g+2*n_gamma+3*n_gN]
    Lambda_F = x[36+3*n_g+2*n_gamma+3*n_gN:36+3*n_g+2*n_gamma+3*n_gN+n_gammaF]
    lambda_F = x[36+3*n_g+2*n_gamma+3*n_gN +
                 n_gammaF:36+3*n_g+2*n_gamma+3*n_gN+2*n_gammaF]
    return a, U, Q, Kappa_g, Lambda_g, lambda_g, Lambda_gamma, lambda_gamma, Kappa_N, Lambda_N, lambda_N, Lambda_F, lambda_F

def get_cylinder_ground_contact(q,u,a):

    # Rotation Matricies
    R1 = np.array([[np.cos(q[3]), np.sin(q[3]), 0],
                   [-np.sin(q[3]), np.cos(q[3]), 0],
                   [0, 0, 1]])
    
    R2 = np.array([[1, 0, 0],
                   [0, np.cos(q[4]), np.sin(q[4])],
                   [0, -np.sin(q[4]), np.cos(q[4])]])
    
    R3 = np.array([[np.cos(q[5]), np.sin(q[5]), 0],
                   [-np.sin(q[5]), np.cos(q[5]), 0],
                   [0, 0, 1]])

    # Fixed basis vectors
    E1 = np.array([1,0,0])
    E2 = np.array([0,1,0])
    E3 = np.array([0,0,1])

    # Needed moving basis vectors
    e1pp = np.transpose(R2@R1)@E1
    e2pp = np.transpose(R2@R1)@E2
    e3 = np.transpose(R3@R2@R1)@E3

    # Relevant angular velocities
    omegapp = u[3]*E3+u[4]*e1pp
    omega = u[3]*E3+u[4]*e1pp+u[5]*e3

    # Relevant basis vectors first time derivatives
    e1ppdot = np.cross(omegapp,e1pp)
    e2ppdot = np.cross(omegapp,e2pp)
    e3dot = np.cross(omega,e3)
    
    # Relevant angular accelerations
    alphapp = a[3]*E3+a[4]*e1pp+u[4]*e1ppdot
    alpha = a[3]*E3+a[4]*e1pp+u[4]*e1ppdot+a[5]*e3+u[5]*e3dot

    # Relevant basis vectors second time derivatives 
    e2ppddot = np.cross(alphapp,e2pp)+np.cross(omegapp,e2ppdot)
    e3ddot = np.cross(alpha,e3)+np.cross(omega,e3dot)

    pi = -h/2*e3-R*e2pp
    pidot = np.cross(omega,pi) #-h/2*e3dot-R*e2ppdot
    piddot = np.cross(alpha,pi)+np.cross(omega,pidot) #-h/2*e3ddot+R*e2ppddot

    vC = np.array([-(u[3] + u[5]*np.cos(q[4]))*(2*R*np.cos(q[4]) - h*np.sin(q[4]))*np.cos(q[3])/2 + (2*R*np.sin(q[4]) + h*np.cos(q[4]))*(u[4]*np.sin(q[3]) - u[5]*np.sin(q[4])*np.cos(q[3]))/2,
                   -(u[3] + u[5]*np.cos(q[4]))*(2*R*np.cos(q[4]) - h*np.sin(q[4]))*np.sin(q[3])/2 - (2*R*np.sin(q[4]) + h*np.cos(q[4]))*(u[4]*np.cos(q[3]) + u[5]*np.sin(q[3])*np.sin(q[4]))/2,
                   u[4]*(R*np.cos(q[4]) - h*np.sin(q[4])/2)])

    aC = np.array([-R*a[3]*np.cos(q[3])*np.cos(q[4]) + R*a[4]*np.sin(q[3])*np.sin(q[4]) - R*a[5]*np.cos(q[3]) + R*u[3]**2*np.sin(q[3])*np.cos(q[4]) + 2*R*u[3]*u[4]*np.sin(q[4])*np.cos(q[3]) + R*u[3]*u[5]*np.sin(q[3]) + R*u[4]**2*np.sin(q[3])*np.cos(q[4]) + a[3]*h*np.sin(q[4])*np.cos(q[3])/2 + a[4]*h*np.sin(q[3])*np.cos(q[4])/2 - h*u[3]**2*np.sin(q[3])*np.sin(q[4])/2 + h*u[3]*u[4]*np.cos(q[3])*np.cos(q[4]) - h*u[4]**2*np.sin(q[3])*np.sin(q[4])/2,
                   -R*a[3]*np.sin(q[3])*np.cos(q[4]) - R*a[4]*np.sin(q[4])*np.cos(q[3]) - R*a[5]*np.sin(q[3]) - R*u[3]**2*np.cos(q[3])*np.cos(q[4]) + 2*R*u[3]*u[4]*np.sin(q[3])*np.sin(q[4]) - R*u[3]*u[5]*np.cos(q[3]) - R*u[4]**2*np.cos(q[3])*np.cos(q[4]) + a[3]*h*np.sin(q[3])*np.sin(q[4])/2 - a[4]*h*np.cos(q[3])*np.cos(q[4])/2 + h*u[3]**2*np.sin(q[4])*np.cos(q[3])/2 + h*u[3]*u[4]*np.sin(q[3])*np.cos(q[4]) + h*u[4]**2*np.sin(q[4])*np.cos(q[3])/2,
                   a[4]*(2*R*np.cos(q[4]) - h*np.sin(q[4]))/2 - u[4]**2*(2*R*np.sin(q[4]) + h*np.cos(q[4]))/2])


    g_N = q[2]+pi[2]
    gdot_N = u[2]+pidot[2]
    gddot_N = a[2]-aC[2] #a[2]+piddot[2]
    W_N = np.zeros(6) # check this
    W_N[2] = 1
    W_N[4] = h/2*(np.sin(q[4]))-R*(np.cos(q[4]))

    gamma_F1 = u[0]-vC[0]
    gamma_F2 = u[1]-vC[1]

    gammadot_F1 = a[0]-aC[0]
    gammadot_F2 = a[1]-aC[1]

    W_F1 = np.zeros(6)
    W_F1[0] = 1
    W_F1[3] = (R*np.cos(q[4]) - h*np.sin(q[4])/2)*np.cos(q[3])
    W_F1[4] = (-R*np.sin(q[4]) - h*np.cos(q[4])/2)*np.sin(q[3])
    W_F1[5] = -(-R*np.sin(q[4]) - h*np.cos(q[4])/2)*np.sin(q[4])*np.cos(q[3]) + (2*R*np.cos(q[4]) - h*np.sin(q[4]))*np.cos(q[3])*np.cos(q[4])/2

    W_F2 = np.zeros(6)
    W_F2[1] = 1
    W_F2[3] = (R*np.cos(q[4]) - h*np.sin(q[4])/2)*np.sin(q[3])
    W_F2[4] = (R*np.sin(q[4]) + h*np.cos(q[4])/2)*np.cos(q[3])
    W_F2[5] = (R*np.sin(q[4]) + h*np.cos(q[4])/2)*np.sin(q[3])*np.sin(q[4]) + (2*R*np.cos(q[4]) - h*np.sin(q[4]))*np.sin(q[3])*np.cos(q[4])/2

    return g_N,gdot_N,gddot_N,W_N,gamma_F1,gammadot_F1,W_F1,\
        gamma_F2,gammadot_F2,W_F2

def get_cylinder_cylinder_contact(q,u,a):

    # Rotation Matricies
    R1I = np.array([[np.cos(q[3]), np.sin(q[3]), 0],
                   [-np.sin(q[3]), np.cos(q[3]), 0],
                   [0, 0, 1]])
    
    R2I = np.array([[1, 0, 0],
                   [0, np.cos(q[4]), np.sin(q[4])],
                   [0, -np.sin(q[4]), np.cos(q[4])]])
    
    R3I = np.array([[np.cos(q[5]), np.sin(q[5]), 0],
                   [-np.sin(q[5]), np.cos(q[5]), 0],
                   [0, 0, 1]])
    
    R1II = np.array([[np.cos(q[9]), np.sin(q[9]), 0],
                   [-np.sin(q[9]), np.cos(q[9]), 0],
                   [0, 0, 1]])
    
    R2II = np.array([[1, 0, 0],
                   [0, np.cos(q[10]), np.sin(q[10])],
                   [0, -np.sin(q[10]), np.cos(q[10])]])
    
    R3II = np.array([[np.cos(q[11]), np.sin(q[11]), 0],
                   [-np.sin(q[11]), np.cos(q[11]), 0],
                   [0, 0, 1]])

    # Fixed basis vectors
    E1 = np.array([1,0,0])
    E2 = np.array([0,1,0])
    E3 = np.array([0,0,1])

    # Necessary basis vectors
    e1Ipp = np.transpose(R2I@R1I)@E1
    e1IIpp = np.transpose(R2II@R1II)@E1
    e1I = np.transpose(R3I@R2I@R1I)@E1
    e1II = np.transpose(R3II@R2II@R1II)@E1
    e2I = np.transpose(R3I@R2I@R1I)@E2
    e2II = np.transpose(R3II@R2II@R1II)@E2
    e3I = np.transpose(R3I@R2I@R1I)@E3
    e3II = np.transpose(R3II@R2II@R1II)@E3

    # Angular velocities
    omegaIpp = u[3]*E3+u[4]*e1Ipp
    omegaIIpp = u[9]*E3+u[10]*e1IIpp
    omegaI = u[3]*E3+u[4]*e1Ipp+u[5]*e3I
    omegaII = u[9]*E3+u[10]*e1IIpp+u[11]*e3II

    # Necessary basis vectors first derivatives
    e1Ippdot = np.cross(omegaIpp,e1Ipp)
    e1IIppdot = np.cross(omegaIIpp,e1IIpp)
    e3Idot = np.cross(omegaI,e3I)
    e3IIdot = np.cross(omegaII,e3II)
    
    # Angular accelerations
    alphaI = a[3]*E3+a[4]*e1Ipp+u[4]*e1Ippdot+a[5]*e3I+u[5]*e3Idot
    alphaII = a[9]*E3+a[10]*e1IIpp+u[10]*e1IIppdot+a[11]*e3II+u[11]*e3IIdot

    # Necessary basis vectors second derivatives
    e3Iddot = np.cross(alphaI,e3I)+np.cross(omegaI,e3Idot)
    e3IIddot = np.cross(alphaII,e3II)+np.cross(omegaII,e3IIdot)

    # Centers of mass positions
    I_xbar = q[0:3]
    II_xbar = q[6:9]

    # Centers of mass velocity
    I_vbar = u[0:3]
    II_vbar = u[6:9]
    
    # Centers of mass acceleration
    I_abar = a[0:3]
    II_abar = a[6:9]

    # Calculating cylinders' contact point
    A = np.array([[1, -np.dot(e3I,e3II)],
                  [-np.dot(e3I,e3II), 1]])
    B = np.array([np.dot(II_xbar-I_xbar,e3I), np.dot(I_xbar-II_xbar,e3II)])
    params = np.linalg.solve(A,B)
    I_d = params[0]
    II_d = params[1]
    # Calculating first derivatives
    Adot = -np.array([[0, np.dot(e3Idot,e3II)+np.dot(e3I,e3IIdot)],
        [np.dot(e3Idot,e3II)+np.dot(e3I,e3IIdot), 0]])
    Bdot = np.array([np.dot(II_vbar-I_vbar,e3I)+np.dot(II_xbar-I_xbar,e3Idot),
        np.dot(I_vbar-II_vbar,e3II)+np.dot(I_xbar-II_xbar,e3IIdot)])
    params_dot = np.linalg.solve(A,Bdot-Adot@params)
    I_d_dot = params_dot[0]
    II_d_dot = params_dot[1]
    # Calculating second derivatives
    Addot = -np.array([[0, np.dot(e3Iddot,e3II)+2*np.dot(e3Idot,e3IIdot)+np.dot(e3I,e3IIddot)],
                       [np.dot(e3Iddot,e3II)+2*np.dot(e3Idot,e3IIdot)+np.dot(e3I,e3IIddot), 0]])
    Bddot = np.array([np.dot(II_abar-I_abar,e3I)+2*np.dot(II_vbar-I_vbar,e3Idot)+np.dot(II_xbar-I_xbar,e3Iddot),
                      np.dot(I_abar-II_abar,e3II)+2*np.dot(I_vbar-II_vbar,e3IIdot)+np.dot(I_xbar-II_xbar,e3IIddot)])
    params_ddot = np.linalg.solve(A,Bddot-Addot@params-2*Adot@params_dot)

    I_d_ddot = params_ddot[0]
    II_d_ddot = params_ddot[1]

    # Calculating normal gap distance between cylinders
    f = I_xbar+I_d*e3I-II_xbar-II_d*e3II
    norm_f = np.linalg.norm(f)
    g_N = norm_f-(R+R)
    # calculating first time derivative of normal distance constraint
    df_dt = I_vbar+I_d_dot*e3I+I_d*e3Idot-II_vbar-II_d_dot*e3II-II_d*e3IIdot
    gdot_N = np.dot(df_dt,f)/norm_f    
    # calculating second time derivative of normal distance constraint
    ddf_ddt = I_abar+I_d_ddot*e3I+2*I_d_dot*e3Idot+I_d*e3Iddot\
        -II_abar-II_d_ddot*e3II-2*II_d_dot*e3IIdot-II_d*e3IIddot
    gddot_N = ((np.dot(ddf_ddt,f)+np.dot(df_dt,df_dt))*np.dot(f,f)
               -(np.dot(df_dt,f))**2)/norm_f**1.5

    # gamma_F, gammadot_F
    I_x = I_xbar+I_d*e3I
    II_x = II_xbar+II_d*e3II  
    v = II_x-I_x
    norm_v = np.linalg.norm(v)



    # contact point on Cylinder I
    pi2 = I_d*e3I+R*v/norm_v
    v2 = I_vbar+np.cross(omegaI,pi2)
    # contact point on Cylinder II
    pi3 = II_d*e3II+R*(-v/norm_v)
    v3 = II_vbar+np.cross(omegaII,pi3)

    # calculating constraints
    gamma_F1 = np.dot(v2-v3,e3I)
    gamma_F2 = np.dot(v2-v3,e3II)
    
 

    I_v = I_vbar+I_d_dot*e3I+I_d*e3Idot
    II_v = II_vbar+II_d_dot*e3II+II_d*e3IIdot
    v_dot = II_v-I_v
    norm_v = np.linalg.norm(v) # np.sqrt(v[0]**2+v[1]**2+v[2]**2)
    I_u = v/norm_v
    u_dot = (v_dot*np.dot(v,v)-v*np.dot(v,v_dot))/norm_v**3

